import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  CompaRoute,
} from "react-router-dom";
import Navigation from "./components/Navigation";
import Login from "./pages/Login";

function App() {
  return (
    <div className="App">
      <Router>
        <Navigation />

        <Switch>
          <Route path="/login" component={Login} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
